var screens = ThisEntity.getStaticModelComponents();
var face = ThisEntity.getVideoPlayerComponents()[0];
var icons = TheEntitySystem.getEntityByName("Icons_Screen1");

var audio = ThisEntity.getAudioComponents();

var counter = 0;

//define functions on globalThis to add functions that can be linked to subscriptions
globalThis.onClick = (_evtName, params) => {
    const { id, cid } = JSON.parse(params);
    OKO.Log(`Clicked entityId: ${id} componentId: ${cid}`);

}

globalThis.onTick = () => {
  counter++;
  if(counter>=(11*60))
  {
    icons.getImageComponents().forEach((img) => {
      img.isVisible = true;
    });
    face.playbackState = 1;
  }
}

globalThis.onTriggerEnter = (_evtName, params) => {
  const { id, cid } = JSON.parse(params);
  OKO.Log(`onTriggerEnter Welcome entityId: ${id} componentId: ${cid}`);

  screens[1].isVisible = false;
  face.isVisible = true;
  face.playbackState = 2;
  audio[0].playbackState = 2;
  audio[0].isLoopPlayback = false;
  icons.getImageComponents().forEach((img) => {
    img.isVisible = false;
  });
  counter = 0;
};

globalThis.onTriggerLeave = (_evtName, params) => {
  const { id, cid } = JSON.parse(params);

  screens[1].isVisible = true;
  face.isVisible = false;
  face.playbackState = 0;
  audio[0].playbackState = 0;
  icons.getImageComponents().forEach((img) => {
    img.isVisible = true;
  });

  OKO.Log(`time elapsed: ${audio[0].timeSincePlay}`);
};

// subscribe to entity events 
ThisEntity.subscribeToMessage("entityClick", "onClick");
ThisEntity.subscribeToMessage("entityTick", "onTick");
ThisEntity.subscribeToMessage("trigger-enter", "onTriggerEnter");
ThisEntity.subscribeToMessage("trigger-leave", "onTriggerLeave");

