var entities = TheEntitySystem.getEntities();
var entityIndex = TheEntitySystem.getIndexOfEntity(ThisEntity.id);

var cord = ThisEntity.getAnimatedModelComponents()[0];
var poiMode = false;
cord.isLoopPlayback = false;

var coll = TheEntitySystem.getEntityByName("PoiColliders");

var user = TheEntitySystem.getAvatars()[0];
const withinSquared = 4;

var poiScreens = TheEntitySystem.getEntityByName("POI");
var lowPos = 1;
var hiPos = lowPos+3;

// POI MEDIA 
var media1 = TheEntitySystem.getEntityByName("BTSV1"); //Video
var m1HP = 4.763;
var m1LP = m1HP-3;

var media2 = TheEntitySystem.getEntityByName("IG1"); //Image Gallery 1
var m2HP = 5.198;
var m2LP = m2HP-3;

var media3 = TheEntitySystem.getEntityByName("IG2"); //Image Gallery2
var m3HP = 4.663;
var m3LP = m3HP-3;

var media4 = TheEntitySystem.getEntityByName("EnvSchem"); // Env Schematics
var m4HP = 5.21;
var m4LP = m4HP-3;

//ANIM
var curFrame = 0;
var anim_steps = (4*60);

var exit = ThisEntity.getImageComponents()[1];


//var screens = TheEntitySystem.getEntityByName("Board_7-31.glb").getAnimatedModelComponents()[0];

//define functions on globalThis to add functions that can be linked to subscriptions
globalThis.onClick = (_evtName, params) => {
    const { id, cid } = JSON.parse(params);
    OKO.Log(`Clicked entityId: ${id} componentId: ${cid}`);

    if(!poiMode && cid==2)
    {

        cord.animationIndex = 0;
        cord.isPlaying = true;
        coll.position = user.position;
        curFrame = 0;
        poiMode = true;

        exit.isVisible = true;
        //poiScreens.position = [poiScreens.position[0], lowPos, poiScreens.position[2]];
        OKO.Log('poi mode');

    }
    else if(poiMode && (cid==2 || cid==3))
    {
        curFrame = 0;
        cord.animationIndex = 1;
        cord.isPlaying = true;
        coll.position = [coll.position[0], coll.position[1]+7, coll.position[2]];
        poiMode = false;
        exit.isVisible = false;
        //poiScreens.position = [poiScreens.position[0], hiPos, poiScreens.position[2]];
        OKO.Log(' exit poi mode');
    }


}

function lerp(a, b, t)
{
  return a + (b-a) * t;
}

globalThis.onTick = () => {
    let componentPos = ThisEntity.position;
    let lastDist = withinSquared;
    TheEntitySystem.getAvatars().forEach((avatar) => {
        let dist = sqDist(componentPos, avatar.position, true);
        if (dist < lastDist) {
            lastDist = dist;
            user = avatar;
        }
    })
    //OKO.Log('User: ' + user.name);

    var u = curFrame/anim_steps;
    if(!poiMode){
        if(curFrame<anim_steps)
        {
            poiScreens.position = [poiScreens.position[0], lerp(lowPos, hiPos, u), poiScreens.position[2]];
            media1.position = [media1.position[0], lerp(m1LP, m1HP, u), media1.position[2]];
            media2.position = [media2.position[0], lerp(m2LP, m2HP, u), media2.position[2]];
            media3.position = [media3.position[0], lerp(m3LP, m3HP, u), media3.position[2]];
            media4.position = [media4.position[0], lerp(m4LP, m4HP, u), media4.position[2]];
            curFrame++;
        }
        else{
            poiScreens.position = [poiScreens.position[0], hiPos, poiScreens.position[2]];
            media1.position = [media1.position[0], m1HP, media1.position[2]];
            media2.position = [media2.position[0], m2HP, media2.position[2]];
            media3.position = [media3.position[0], m3HP, media3.position[2]];
            media4.position = [media4.position[0], m4HP, media4.position[2]];
            //curFrame = anim_steps;
        }
    }
    else{
        if(curFrame<anim_steps)
        {
            poiScreens.position = [poiScreens.position[0], lerp(hiPos, lowPos, u), poiScreens.position[2]];
            media1.position = [media1.position[0], lerp(m1HP, m1LP, u), media1.position[2]];
            media2.position = [media2.position[0], lerp(m2HP, m2LP, u), media2.position[2]];
            media3.position = [media3.position[0], lerp(m3HP, m3LP, u), media3.position[2]];
            media4.position = [media4.position[0], lerp(m4HP, m4LP, u), media4.position[2]];
            curFrame++;
        }
        else{
            poiScreens.position = [poiScreens.position[0], lowPos, poiScreens.position[2]];
            media1.position = [media1.position[0], m1LP , media1.position[2]];
            media2.position = [media2.position[0], m2LP , media2.position[2]];
            media3.position = [media3.position[0], m3LP , media3.position[2]];
            media4.position = [media4.position[0], m4LP , media4.position[2]];
            //curFrame = anim_steps;
        }
    }

    //OKO.Log('frame: ' + curFrame);
}

function sqDist(p1, p2, projected) {
    if (p1.length != 3 || p1.length != p2.length)
        { return NaN; }
    let dims = [];
    if (projected) { dims = [0, 2]; }
    else { dims = [0, 1, 2]; }
    let dist = 0;
    dims.forEach((i) => {
        var delta = p1[i] - p2[i];
        dist += delta * delta;
    })
    return dist;
}



